(13, '', 'Man of Steel', 'Action', 'Zack Snyder', 'Henry Cavill as Superman', '147 minutes', 'Englisth', 'June 14, 2013', 'https://www.youtube.com/watch?v=T6DJcgm3wNY', '2D', 'Man of Steel is a film based on the origins of Superman. \nDirected by Zack Snyder, produced by Christopher Nolan, \nand starring Henry Cavill as the title character, the film was released \non June 14, 2013. It served as a launchpad for the DC Extended \nUniverse, a shared cinematic universe based on the DC properties \nand serves as one of many worlds of the Multiverse according to \nThe Flash movie .[1]');
INSERT INTO `movie` (`id`, `image`, `title`, `genre`, `director`, `cast`, `duration`, `language`, `release_date`, `trailer_url`, `display`, `detail`) VALUES
(14, '', 'Legend of the Guardians: The Owls of Ga\'Hoole', 'Animation', 'Zack Snyder', 'Helen Mirren, Geoffrey Rush', '97 minutes', 'English', 'September 19, 2010', 'https://www.youtube.com/watch?v=I_vJ0jS3i3o', '2D', 'Legend of the Guardians: The Owls of Ga\'Hoole is a 2010 animated fantasy adventure film directed by Zack Snyder. Based on the Guardians of Ga\'Hoole book series by Kathryn Lasky, the film was written by John Orloff and Emil Stern and features the voices of Helen Mirren, Geoffrey Rush, Jim Sturgess, Hugo Weaving, Emily Barclay, Abbie Cornish, Ryan Kwanten, Anthony LaPaglia, Miriam Margolyes, Sam Neill, Richard Roxburgh, and David Wenham. An international co-production between the United States and Australia, the film was produced by Village Roadshow Pictures and Animal Logic, following their success with the 2006 film Happy Feet. In the film, Soren (Sturgess), a barn owl, is kidnapped and taken to St. Aegolius Academy for Orphaned Owls led by Metal Beak (Joel Edgerton) and Nyra (Mirren), where owlets are brainwashed into becoming soldiers. He befriends a fellow owl named Gylfie (Barclay), and they later escape the facility to find the Island of Ga\'Hoole with new-found friends and together fight against the evil army.');
INSERT INTO `movie` (`id`, `image`, `title`, `genre`, `director`, `cast`, `duration`, `language`, `release_date`, `trailer_url`, `display`, `detail`) VALUES
(15, '', '9', 'Animation', 'Shane Acker', 'Elijah Wood, John C. Reilly', '79 minutes', 'English', 'September 9, 2009', 'https://www.youtube.com/watch?v=_qApXdc1WPY', '2D', '9 is a 2009 animated science fiction film directed by Shane Acker, written by Pamela Pettler and produced by Jim Lemley, Tim Burton, Timur Bekmambetov and Dana Ginsburg. Set in an alternate version of the 1940s, the film follows a rag doll labeled \"9\" who awakens shortly after the end of mankind following the uprising of machines. The film features the voices of Elijah Wood, John C. Reilly, Jennifer Connelly, Christopher Plummer and Crispin Glover, with Martin Landau and Fred Tatasciore.[1][7][8]\n\nThe film is based on Acker\'s 2005 CG-animated, Academy Award-nominated short film of the same name created at the UCLA Animation Workshop.[9] Focus Features released it theatrically on September 9, 2009. The film received generally mixed reviews from critics, earned $48.4 million on a $30 million budget and received a Outstanding Producer of Animated Theatrical Motion Pictures nomination in 21st Producers Guild of America Awards. The film was released on DVD and Blu-ray on December 29, 2009.'),
(16, '', '2012', 'Sci-Fi', 'Roland Emmerich', 'John Cusack, Chiwetel Ejiofor', '158 minutes', 'English', 'November 13, 2009', 'https://www.youtube.com/watch?v=ce0N3TEcFw0', '2D', '2012 is a 2009 American epic science fiction disaster film directed by Roland Emmerich, written by Emmerich and Harald Kloser, and stars John Cusack, Amanda Peet, Chiwetel Ejiofor, Oliver Platt, Thandiwe Newton,[a] Danny Glover and Woody Harrelson. Based on the 2012 phenomenon, its plot follows geologist Adrian Helmsley (Ejiofor) and novelist Jackson Curtis (Cusack) as they struggle to survive an eschatological sequence of events including earthquakes, volcanic eruptions, megatsunamis, and a global flood.');
INSERT INTO `movie` (`id`, `image`, `title`, `genre`, `director`, `cast`, `duration`, `language`, `release_date`, `trailer_url`, `display`, `detail`) VALUES
(17, '', 'ThaBinThal Mya Hnin Si 2', 'Horror', 'Min Set', 'May Mi Ko Ko', '120 Min', '-', '2024-09-06', 'https://www.youtube.com/watch?v=qTy-IFN_Bnc', '2D', 'မေမေက သိပ်လှတယ် ... သိပ်လည်း ထက်မြက်တယ်\nပြီးတော့  သိပ်ရက်စက်တယ် ...🌹\n\n\" သဘင်သည်မြနှင်းဆီ : THE BEGINNING \"\n ⁃  𝐎𝐅𝐅𝐈𝐂𝐈𝐀𝐋 𝐓𝐑𝐀𝐈𝐋𝐄𝐑\n ⁃ ရုပ်ရှင်ဇာတ်ကားကြီး\n\n------------------------------------\nရုံပိတ်ကားပေါ်မှာမြင်တွေ့ကြရတော့မယ့်\nသဘင်သည်မြနှင်းဆီ ရဲ့  Beginning Story ...\n\nပရိသတ်တွေတခဲနက်အားပေးခဲ့ကြတဲ့  နှစ်ပေါင်းများစွာမကျွတ်မလွတ်ဘဲရှိနေတဲ့ အငြိမ့်မင်းသမီးသရဲအကြောင်း ရိုက်ကူးထားတဲ့ \" သဘင်သည်မြနှင်းဆီ \" ရုပ်သံဇာတ်လမ်းတွဲကြီးရဲ့ Prequel ရုပ်ရှင်ဖြစ်တဲ့ ....\n\n\" သဘင်သည်မြနှင်းဆီ - The Beginning \" ရုပ်ရှင်ဇာတ်ကားကြီးကို  ၂၀၂၄ ခုနှစ် ဩဂုတ်လအတွင်းမှာ ရုံပိတ်ကားပေါ်မှာ ခံစားကြည့်ရှုကြရတော့မှာပဲ ဖြစ်ပါတယ် ...\n\nဒီရုပ်ရှင်ဇာတ်ကားကြီးမှာတော့  မြနှင်းဆီ တစ်ယောက် အငြိမ့်မင်းသမီး ဘယ်လိုဖြစ်လာခဲ့လဲဆိုတဲ့အကြောင်းကို သေချာသိကြရတော့မှာဖြစ်ပြီး  ...\n\nသူမရဲ့ငယ်ဘဝ ၊ သူမရဲ့မိသားစု ၊ သိပ်ကိုရက်စက်ကြမ်းတမ်းလှတဲ့  သူမရဲ့မေမေ အကြောင်းကို သေချာကြည့်ရှုခံစားကြရတော့မှာပါ\n\n\" သဘင်သည် မြနှင်းဆီ \"ကို ရုံပိတ်ကားထက်မှာ ခံစားကြည့်ရှုချင်တဲ့ ချစ်သောပရိသတ်တွေရဲ့ဆန္ဒ တကယ်ဖြစ်လာအောင် အခွင့်အရေးပေးခဲ့တဲ့  ဆင်ဆာလူကြီးမင်းတွေအားလုံးနဲ့  လေးစားရပါသော ရုပ်ရှင်ရုံပိုင်ရှင်များအားလုံးကို ကျေးဇူးအထူးတင်ရှိပါတယ် .... 🙏\n\n၂၀၂၄ ဩဂုတ်လအတွင်းမှာ သဘင်သည်မြနှင်းဆီတစ်ယောက် ရုံပိတ်ကားထက်မှာ  အလှပဆုံးဖူးပွင့်ပါတော့မယ် ...🌹\n\n--------------------------------------\nPresents by - SEIN HTAY Film Production\nCreation by - LOVE TV\nDirected by - KO SET\nStory by - KOSET & EINGJIN HAN\nScreenplay by - EINGJIN HAN\nDirector of Photography - LINN THEIN\nHair & MUA - OMEGA MEE MEE\nArt Director - SI THU OHT SOE\nCostume Design - STUDIO 5 SIS\nCamrea - iFilm Production\nPhoto - KAN SU HO\nPoster Design - LOVE TV\n\n#သဘင်သည်မြနှင်းဆီ_TheBeginning\n#ရုပ်ရှင်ဇာတ်ကားကြီး #InCinemas\n#SeinHtayFilmProduction #LOVETV');

